from collections import Counter
from typing import List


class Solution:
    def findSubstring(self, s: str, words: List[str]) -> List[int]:
        if not words:
            return []

        # the necessary length of the concatenated substring
        ns = len(s)
        nw = len(words)
        word_len = len(words[0])
        concat_len = nw * word_len

        if concat_len > len(s):
            return []

        # ctrs = [Counter(word) for word in words]
        indices = []
        right = 0

        for left in range(ns - concat_len + 1):
            right = left
            needed_words = Counter(words)
            while right < left + concat_len:
                subword = s[right:right + word_len]
                found = True
                if subword in needed_words:
                    needed_words[subword] -= 1
                    +needed_words
                else:
                    break
                right += word_len
            if needed_words == Counter():
                indices.append(left)


        return indices

